import React from 'react'

function NameList() {
    const names=[{
        id:"1",
        name:"Bruce",
        age:28,
        skill:"React"
    },{
        id:"2",
        name:"Clark",
        age:25,
        skill:"Angular"
    },{
        id:"3",
        name:"Diana",
        age:24,
        skill:"Vue"
    }]
    const nameList=names.map((name)=><h3>{names.name} {names.age} {names.skill}</h3>)
    return (
        <div>
            {nameList}
        </div>
    )
}

export default NameList
